import "./header.css";

export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitlesLarge">Green Kitchen Stories</span>
        <span className="headerTitlesSmall">Cooking on a budget</span>
      </div>
      <img className="headerImage" src="" alt="cooking" />
    </div>
  );
}

